import React from "react";
import Common from './Common';
import Footer from "./Footer";
import Pic from "../src/Images/Alpha2.png";
const About = () => {
  return (
    <>
      <Common Hed="Welcome on about Page"
        bton="Contact Here"
        img={Pic}
        lik="/contact"
      />
      
    </>
  )
}
export default About;
